import React from 'react'

const DeletePopup = () => {
    return(
        <div className="delete__popup">
            <div className="delete__box">
                <h1>Remove this task?</h1>
                <div className="delete__buttons">
                    <button>Yes</button>
                    <button>No</button>
                </div>

            </div>
        </div>
    );
}

export default DeletePopup;
